// GroupList.js
import React from 'react';

const GroupList = ({ groups, onSelectGroup }) => {
  return (
    <ul className="p-4 space-y-2">
      {groups.map((group) => (
        <li
          key={group.id}
          className="cursor-pointer hover:bg-gray-700 p-2 rounded-lg"
          onClick={() => onSelectGroup(group.id)}
        >
          {group.name}
        </li>
      ))}
    </ul>
  );
};

export default GroupList;
